import { Component } from "react";

export class Form extends Component {
  state = {
    inputValue: "123",
  };
  render() {
    const { inputValue } = this.state;
    return (
      <form>
        <label>
          <input type="text" value={this.state.inputValue} />
        </label>
      </form>
    );
  }
}
